export const Text = ({ text, fontSize, textAlign, color }) => {
	const {
		connectors: { connect, drag },
		hasSelectedNode,
		hasDraggedNode,
		isActive,
		actions: { setProp },
	} = useNode((state) => ({
		hasSelectedNode: state.events.selected.size > 0,
		hasDraggedNode: state.events.dragged.size > 0,
		isActive: state.events.selected,
	}));

	const [editable, setEditable] = useState(false);

	useEffect(() => {
		!hasSelectedNode && setEditable(false);
	}, [hasSelectedNode]);

	return (
		<div ref={(ref) => connect(drag(ref))} onClick={(e) => setEditable(true)}>
			<ContentEditable
				disabled={!editable}
				html={text}
				onChange={(e) =>
					setProp(
						(props) =>
							(props.text = e.target.value.replace(/<\/?[^>]+(>|$)/g, ''))
					)
				}
				tagName="p"
				style={{
					fontSize: `${fontSize}px`,
					textAlign,
					padding: 1,
					margin: 5,
					color,
				}}
			/>
			{/* {
        hasSelectedNode && (
          <FormControl className="text-additional-settings" size="small">
            <FormLabel component="legend">Font size</FormLabel>
            <Slider
              defaultValue={fontSize}
              step={1}
              min={7}
              max={50}
              valueLabelDisplay="auto"
              onChange={(_, value) => {
                setProp(props => props.fontSize = value);
              }}
            />
          </FormControl>
        )
      } */}
		</div>
	);
};

export const TextSettings = () => {
	const {
		actions: { setProp },
		fontSize,
		color,
	} = useNode((node) => ({
		fontSize: node.data.props.fontSize,
		color: node.data.props.color,
	}));

	return (
		<>
			<FormControl size="small" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Font size
				</FormLabel>
				<Slider
					value={fontSize || 7}
					step={7}
					min={1}
					max={50}
					onChange={(_, value) => {
						setProp((props) => (props.fontSize = value));
					}}
				/>
			</FormControl>

			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Color
				</FormLabel>
				<ColorPicker
					defaultValue={color}
					onChange={(color) => {
						setProp((props) => (props.color = color));
					}}
				/>
			</FormControl>
		</>
	);
};

