export const ContainerSettings = () => {
	const {
		background,
		padding,
		width,
		height,
		gap,
		actions: { setProp },
	} = useNode((node) => ({
		background: node.data.props.background,
		padding: node.data.props.padding,
		width: node.data.props.width,
		height: node.data.props.height,
		gap: node.data.props.gap,
		flexDirection: node.data.props.flexDirection,
		border: node.data.props.border,
	}));
	return (
		<div>
			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Background
				</FormLabel>
				<ColorPicker
					defaultValue={background || '#000'}
					onChange={(color) => {
						if(color)
							setProp((props) => (props.background = color));
					}}
				/>
			</FormControl>
			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Padding
				</FormLabel>
				<Slider
					defaultValue={padding}
					onChange={(_, value) => setProp((props) => (props.padding = value))}
				/>
			</FormControl>

			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Witdh
				</FormLabel>
				<Slider
					defaultValue={width}
					max={800}
					onChange={(_, value) => setProp((props) => (props.width = value))}
				/>
			</FormControl>

			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Height
				</FormLabel>
				<Slider
					defaultValue={height}
					max={800}
					onChange={(_, value) => setProp((props) => (props.height = value))}
				/>
			</FormControl>

			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Flex Direction
				</FormLabel>

				<MaterialButton
					style={{ color: 'white' }}
					onClick={() => {
						setProp((props) => (props.flexDirection = 'column'));
					}}
				>
					Column
				</MaterialButton>

				<MaterialButton
					style={{ color: 'white' }}
					onClick={() => {
						setProp((props) => (props.flexDirection = 'row'));
					}}
				>
					Row
				</MaterialButton>
			</FormControl>

			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Border
				</FormLabel>

				<MaterialButton
					style={{ color: 'white' }}
					onClick={() => {
						setProp((props) => (props.border = !props.border));
					}}
				>
					Border
				</MaterialButton>
			</FormControl>
			<FormControl fullWidth={true} margin="normal" component="fieldset">
				<FormLabel component="legend" style={{ color: 'white' }}>
					Gap
				</FormLabel>
				<Slider
					defaultValue={gap}
					max={100}
					onChange={(_, value) => setProp((props) => (props.gap = value))}
				/>
			</FormControl>
		</div>
	);
};

